import Navbar from "./navbar";
import Footer from "./footer";
import { BrowserRouter } from "react-router-dom";

const Home = () => {
    return (<>
        <BrowerRouter>
        <Navbar />
        <h1 className="h-screen" >
            Hello world!
        </h1>
        <Footer/>
        </BrowerRouter>
    </>);
}

export default Home; <>

</>
